DROP TABLE IF EXISTS dim_polling_district
;

CREATE TABLE dim_polling_district
(   dpd_id             int(4) NOT NULL AUTO_INCREMENT
  , dpd_dw_id          tinyint
  , dpd_name           VARCHAR(100)
  , dpd_short_name     CHAR(2)
  , dpd_2013_count     int(6)
  , PRIMARY KEY (dpd_id)
  , CONSTRAINT fk1_dpd_dw_id FOREIGN KEY fk1_dpd_dw_id (dpd_dw_id) REFERENCES dim_ward (dw_id)
     )   
     ENGINE=InnoDB
     CHARACTER SET=utf8
     COLLATE=utf8_unicode_ci
     COMMENT="Holds Polling District Dimension"
;



